const sorting = (a, b) => {
  if (a.position < b.position) {
    return -1;
  }
  if (parseInt(a.position) > parseInt(b.position)) {
    return 1;
  }
  if (parseInt(a.timestamp) < parseInt(b.timestamp)) {
    return -1;
  }
  return 1;
};

export default sorting;
